        );
    }
}

class HeaderComponent extends Component {
    render() {
        return (
            <nav className='navbar navbar-default' color='light'>
                <div className='navbar-header'>
                <img
                    src="/CookYLogo.png"
                    width="100%"
                    height="30"
                    className="d-inline-block align-top"
                    alt=""
                />
                </div>
          </nav>
        );
    }
}

export default CookYStories;
